import React, { useState, useEffect, useCallback } from "react";
import UserMenu from "../../components/Layout/UserMenu";
import Layout from "./../../components/Layout/Layout";
import axios from "axios";
import moment from "moment";
import { useAuth } from "../../context/auth";

const Orders = () => {
  const [orders, setOrders] = useState([]);
  const [auth] = useAuth();

  const token = auth?.token;

  const getOrders = useCallback(async () => {
    try {
      const { data } = await axios.get("/api/v1/payment/userorders", {
        headers: {
          Authorization: `Bearer ${token}`,
        },
      });
      setOrders(data);
    } catch (error) {
      console.log(error);
    }
  }, [token]);

  useEffect(() => {
    if (token) getOrders();
  }, [token, getOrders]);

  return (
    <Layout title={"Your Orders"}>
      <div className="container-flui p-3 m-3 dashboard">
        <div className="row">
          <div className="col-md-3">
            <UserMenu />
          </div>
          <div className="col-md-9">
            <h1 className="text-center">All Orders</h1>
            <div>
              {orders?.map((order, index) => (
                <div className="border shadow p-3 mb-4" key={order._id}>
                  {/* Table for Order Details */}
                  <table className="table">
                    <thead>
                      <tr>
                        <th>#</th>
                        <th>Order ID</th>
                        <th>Payment ID</th>
                        <th>Status</th>
                        <th>Amount</th>
                        <th>Date</th>
                      </tr>
                    </thead>
                    <tbody>
                      <tr>
                        <td>{index + 1}</td>
                        <td>{order.orderId}</td>
                        <td>{order.paymentId}</td>
                        <td>{order.payStatus}</td>
                        <td>₹{order.amount}</td>
                        <td>{moment(order.orderDate).format("DD MMM YYYY, h:mm A")}</td>
                      </tr>
                    </tbody>
                  </table>

                  {/* Shipping Info */}
                  <h5 className="mt-3">Shipping Information:</h5>
                  <p><b>Address:</b> {order.userShipping}</p>
                  <p><b>User ID:</b> {order.userId}</p>

                  {/* Order Items */}
                  <h5 className="mt-3">Ordered Items:</h5>
                  <div className="container">
                    {order.orderItems.map((item, i) => (
                      <div className="row mb-2 p-3 card flex-row" key={i}>
                        <div className="col-md-8">
                          <p><b>Item:</b> {item.name}</p>
                          <p><b>Description:</b> {item.description || "N/A"}</p>
                          <p><b>Price:</b> ₹{item.price}</p>
                        </div>
                      </div>
                    ))}
                  </div>
                </div>
              ))}
            </div>
          </div>
        </div>
      </div>
    </Layout>
  );
};

export default Orders;
